import './style.css'
import { useState, useEffect } from 'react';

const Home = ()=>{
    const [crypto,setCrypto] = useState([]);
    const fetchData = async ()=>{
        const response = await fetch("https://api.coinstats.app/public/v1/coins?skip=0&limit=10&currency=INR")
        setCrypto(await response.json())
        console.log(crypto)
    }
    useEffect(()=>{
        fetchData()
    },[])
    return(
        <div className="wrapper">
            <div className="card">
                <span>ID:1</span>
                <span>Name:Bit</span>
                <span>Price:₹</span>
                <span>Market Cap:55352206547139.164</span>
                <span>Volume:19651851800673.332</span>
                <span>Circulating Supply:19027237</span>
            </div>
            <div className="card">
                <span>ID:2</span>
                <span>Name:"Ethereum"</span>
                <span>Price:₹212828.68</span>
                <span>Market Cap:25666970086275.887</span>
                <span>Volume:3256516817776.313</span>
                <span>Circulating Supply:120599204.374</span>
            </div>
            <div className="card">
                <span>ID:3</span>
                <span>Name:Tether</span>
                <span>Price:₹76.64</span>
                <span>Market Cap:6372983974776.578</span>
                <span>Volume:2.1115832193529348e+40</span>
                <span>Circulating Supply:83152877108.0891</span>
            </div>
        </div>
    );
}

export default Home;
